import React from 'react';

const homeStyle = {
  maxWidth: '800px',
  margin: '0 auto',
  padding: '20px',
};

const titleStyle = {
  fontSize: '32px',
  marginBottom: '20px',
  color: '#333',
};

const paragraphStyle = {
  fontSize: '18px',
  marginBottom: '15px',
  color: '#666',
};

const headingStyle = {
  fontSize: '24px',
  marginTop: '30px',
  marginBottom: '15px',
  color: '#333',
};

const listStyle = {
  listStyle: 'disc',
  marginLeft: '20px',
  marginBottom: '20px',
  color: '#666',
};

const listItemStyle = {
  fontSize: '16px',
  marginBottom: '5px',
};

const formStyle = {
  maxWidth: '400px',
  margin: '0 auto',
};

const inputStyle = {
  width: '100%',
  padding: '10px',
  marginBottom: '15px',
  border: '1px solid #ccc',
  borderRadius: '4px',
};

const labelStyle = {
  display: 'block',
  fontWeight: 'bold',
  marginBottom: '5px',
  color: '#333',
};

const buttonStyle = {
  padding: '12px 24px',
  backgroundColor: '#007bff',
  color: '#fff',
  border: 'none',
  borderRadius: '4px',
  fontWeight: 'bold',
  cursor: 'pointer',
  transition: 'background-color 0.3s',
};

function Contact() {
  return (
    <div>
      <h2>Agende sua consulta aqui</h2>
      <p>Entre em contato conosco!</p>
    </div>
  );
}

export default Contact;
